import React from 'react'
import Navbar from './Nav';
import products from './data'
import Card from './Card';
function Home() {
  const renderList = products.map((item, index) => 
                               <div key={index}>{item}</div>
                             );
  console.log(products);
  return (
    <div className="App">
      {renderList}
    </div>
  );
}

export default Home;
